import React from "react";
import ContentItem from "./ContentItem";
import ContentHeader from "./ContentHeader";
import ContentImg from "./ContentImg";

const ContetntItems = (props) => {
  const { repos } = props;
  console.log(repos);
  if (!repos || repos.length === 0) return <p>No repos, sorry</p>;
  return (
    <div>
      {repos.map((repo) => {
        return (
          <div key="">
            <ContentHeader partMovier="{repo.name}" fullviewurl="{repo.fullviewurl}" />
            <ContentItem
              urlMovie="{repo.urlMovie}"
              urlImage="{repo.urlImage}"
              rate="{repo.rate}"
              imdb="{repo.imdb}"
              name="{repo.fullname}"
            />
            <ContentImg poster="{repo.poster}" urlPoster="{repo.urlPoster}" />
          </div>
        );
      })}
    </div>
  );
};

export default ContetntItems;
